import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() {
        var settings = {

            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <Slider {...settings}>

                <div >
                    1

                    <video

                        src="https://ernesto-perez.com/wp-content/uploads/2019/08/video.mp4"
                        autoPlay
                        type="video/mp4">
                    </video>
                </div>

                <div>
                  2
                </div>
            </Slider>
        );
    }
}

export default HeroCarousel;
